import styled from "styled-components";

const Container = styled.div`
  height: 100px;
  width: fit-content;
  display: flex;
  justify-content: center;
  align-items: center;
  margin: 0 auto;
  background-color: black;
`;

export function Navbar() {
  return (
    <>
      <Container>
        <>UNTITLED</>
      </Container>
    </>
  );
}
